# Welcome to QTM 385!

This is a class that is going to provide an overview of the statistical methods that underpin modern machine learning techniques.

- The goal of this class is to introduce the basics of statistical machine learning.

--

- Part 1a: Basics of Predictive Modeling, In-Sample vs. Out-of-Sample accuracy, nifty computational tools

- Part 1b: Linear Regression and Extensions, Supervised Learning for Continuous Outcomes

- Part 2: Classification methods, Modeling discrete outcomes

- Part 3: Unsupervised learning - descriptive models and dimensionality reduction

class: inverse

# What is Machine Learning

Machine learning arose as a subfield of artifical intelligence

- The goal of machine learning is to find scalable implementations of predictive algorithms that successfully predict the future

- Goal of self-improvement: more data means better predictions

- A branch of computer science

--

Machine learning is currently a *buzzphrase* - everything is machine learning!

--

But what is it really?

---
class: inverse

# Statistics

An old field that started as a branch of mathematics

- Build models with explicitly programmmed instructions

- Focused on **inference** - relationships between variables

--

Prior to the 1990s, statistics was largely concerned with proving properties related to experiments!

- Work on prediction regarding time series data, but forecasting was largely considered to be beside the fact.

- Regression methods severely hampered by inability to manipulate matrices.

---
class: inverse

# Statistical Learning

A mashup of the two fields

- Using the fine-tuned inferential tools from statistics, build better **predictive** models that yield generalizable preditive patterns.

- Interpretability vs. Accuracy

- Coined by Michael I. Jordan (the Michael Jordan of the statistical learning field) who suggested that a placeholder for the entire field be called **data science**.

--

Machine learning

- Prioritize interpretability and knowledge of inner-workings over scalable black-box algorithms

--

Statistics

- Prioritize generalizability over inferential properties (out-of-sample instead of in-sample)


---
class: inverse

# The general problem

Suppose we have a sequence of outcome measurements, `\(\boldsymbol{y} = \{y_1,y_2,...,y_N\}\)`

- Observed most of the time, but need not be observed!

--

For each observation `\(i \in (1,N)\)`, we also observe a vector of `\(p\)` predictor measurements, `\(\boldsymbol{x}_i\)`

- Covariates, features, predictors, regressors, inputs, etc.

--

We believe that there is a relationship between `\(\boldsymbol{y}\)` and `\(\boldsymbol{X}\)` - at least one of the `\(\boldsymbol{x}_j \in (1,P)\)` tells us something about `\(\boldsymbol{y}\)`.

---
class: inverse

# The general problem

The goal of statistical learning is to **model** the relationship between the predictors and the outcome:

`$$y_i = f(\boldsymbol{x}_i) + \epsilon_i$$`
where `\(f(\cdot)\)` is an unknown function and `\(\epsilon_i\)` is a **random error** where `\(E[\epsilon] = 0\)`.

--

The goal of statistical learning is to learn `\(f(\cdot)\)` and separate **noise** from **signal**!

# Why Estimate the Function?

Why do we care about estimating the function?

There are three broad reasons (not exhaustive or exclusive!):

--
  
- Causal Inference
  
- Description

- Prediction

---
class: inverse

# Causal Inference

Given a set of features, what are the **causes** of the outcome?  What is the effect of a feature on the outcome?

- A difficult task.

- Requires a lot of design assumptions! (Those pesky confounders...)

- Lots of work combining machine learning and causal inference

- Other classes in the QTM department cover this topic in depth!

- We'll discuss this from time to time, but it's not the main goal of the course.

---
class: inverse

# Description

Given a set of features (and potentially outcomes), how is the data **structured**?  What goes together?  What kinds of observations do we see?  How do the predictors **relate** to one another and the outcome?

- May seem simple and achievable with summary statistics.

- Becomes much more difficult with **high dimensional data** - lots of covariates.

- Find structure within the data.

- Concerned with describing **the data we have**

# Description

For the purposes of this class, we're largely going to approach the problem of description using a suite of methods called *unsupervised learning*.

- In this situation, only covariates are observed (though there are methods that have outcomes)

- Build models that only use the predictors to guess what the outcome would have been and build a model from there

- Market segmentation, latent variables, etc.

- Clustering, orthogonal dimension extraction, matrix decompositions, covariance analysis

- We will consider unsupervised learning towards the end of this course.

---
class: inverse

class: inverse

# Prediction

The vast majority of this class will be devoted to the notion of **predictive modeling**

- If we can produce a good estimate for `\(f()\)` and the variance of the errors aren't too larger, then we can make accurate predictions for the outcome based on new values of the predictors.


Example: Direct Mailing Predictions

- Interested in predicting how much money an individual will donate based on 90,000 people with over 400 different recorded covariates.

- We don't care too much about **how** the predictors lead to the outcome.

- Just want to know if I should send out a mailer requesting a donation for a given individual.

- Maybe want to know which predictors are important for predicting donations.

---
class: inverse

# Prediction

How do we estimate `\(f()\)`?

- We will assume that have observed a set of training data:

`$$\{ (\boldsymbol{x}_1, y_1),(\boldsymbol{x}_2, y_2),...,(\boldsymbol{x}_N, y_N) \}$$`

- Use the training data and a statistical methods to estimate `\(f()\)`.

- Statistical learning methods: parametric methods and non-parametric methods.

- Find a `\(f()\)` that predicts well on out-of-sample data.

---
class: inverse

# Supervised Learning

- Outcome measurement Y

- Vector of `\(p\)` predictor measurements X

- In the regression problem, Y is a continuous quantitative outcome (e.g. price, blood pressure, etc.)

- In the classification problem, Y takes a value in a finite, unordered set (e.g. survivied/died, digit 0-9, cancer class of tissue sample, etc.)

- Supervised in the sense that we know the outcome and can **train** a model to predict the outcomes.

---
class: inverse

# Supervised Learning

Objectives given training data:

- Understand which inputs admit signal and which are just noise in the training data

- Accurately predict unseen test cases

- Assess the quality of our predictions and make claims about how well the model will perform on new data.

---

# Supervised Learning

This is an example of a **supervised** problem:

- Sales is an observed response or target that we wish to predict, `\(Y\)`.

- TV (X_1), Radio (X_2), and Newspaper (X_3) are features that theoretically correlate with our outcome.

--

If we knew `\(f(X_1,X_2,X_3)\)` as it relates to `\(Y\)`, then we could answer any question we wanted about the relationship between `\(X\)` and `\(Y\)`.

- But, we never really know the function!

- Need to estimate.


---
class: inverse

# Parametric Methods

Reduce the problem of estimating `\(f()\)` down to one of estimating a set of parameters.

A two step model-based approach.

Step 1:

- Make some assumption about the functional form of `\(f()\)`.

- The most common example is a linear model:

`$$f(\boldsymbol{x}_i) = \beta_0 + \beta_1 x_{i1} + \beta_2 x_{i2} + ... + \beta_p x_{ip}$$`

---
class: inverse

# Parametric Methods

Reduce the problem of estimating `\(f()\)` down to one of estimating a set of parameters.

A two step model-based approach.

Step 2:

- Use the training data to fit the model

- Find values for the parameters that minimize some **loss criteria** - make the model **predict** the outcomes as closely as possible

- OLS is one example of this

- Other approaches exist (we'll talk about a lot of approaches)

---
class: inverse

# Nonparametric Methods

In constrast, nonparametric methods do not make explicit assumptions about the functional form of `\(f()\)`.

- Use the data to estimate **local** patterns and use these to find piecewise linear representations of the functional forms

- More complicated to think about.

--

Nonparametric methods seem more advantageous for prediction, but they come at the cost of interpretability!

---
class: inverse

# Parametric vs. Nonparametric

Both approaches have pros and cons.

Parametric approaches:

Pros

- Interpretable!  We all know what a regression coefficient means.

- Easier to fit.

- The **assumptions** about functional form do a lot of the heavy lifting.  Restricts the space of possible models.

Cons:

- The big one - what if our assumption is wrong?

---
class: inverse

# Parametric vs. Nonparametric

Both approaches have pros and cons.

Nonparametric approaches:

Pros

- Assumptions about functional form are less consequential.  We still need to make some guesses, but they can be overcome

- Can **learn** weird functions that we couldn't specify beforehand

Cons:

- Not really interpretable.  How do we explain why it's getting what it's getting?

- Need lots of data!

- Can easily **overfit** to the data and provide bad out-of-sample predictions.

- Lots of difficulty **extrapolating** beyond convex hull of training set.

# Training the Model

These approaches are methods for **training** the predictive model:

- Data goes in, function comes out!

- Figure out the predictors that are signal and which are just noise.

--

Just the first step in the statistical learning process!

- Assess the ability of the model **predict** outcomes on new data.

---
class: inverse

# Testing the Model

In a supervised problem, we have the true outcomes, `\(y_i\)`, and the **predicted outcomes** admitted by the trained model, `\(f(X_i) = \hat{y}_i\)`.

Given a model fit, we want to assess the **model accuracy**.

--

A commonly used metric is the **mean squared error** (MSE) - a common example of a **loss function**:

`$$\frac{1}{N} \sum_{i =1}^N (y_i - \hat{y}_i)^2$$`
--

The MSE tells us how closely our model fits the data - is our prediction close to the truth?

---
class: inverse

# Testing the Model

Mean squared error is a heavily studied term.  It can be decomposed into the following form:

`$$MSE = \text{Bias}^2 + \text{Var} + \sigma^2$$`
--

Let's look at each term individually.

---
class: inverse

# Testing the Model

Bias - constant differences between our predictions and the truth.

- Supposing we have the right model, would theoretically remain constant if we were to repeatedly collect data and use it to estimate `\(f()\)`.

- For a single data set, bias is how far our predictions are from the truth.

- In general, more flexibility means less bias.

---
class: inverse

# Testing the Model

&lt;img src=&quot;data:image/png;base64,#Lecture1_files/figure-html/unnamed-chunk-16-1.png&quot; width=&quot;75%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;


---
class: inverse

# Testing the Model

Variance - how much `\(f()\)` changes if we use a different sample as the **training data**

- How much of the &quot;signal&quot; is noise that we are attributing as signal because we are only seeing one sample?

- Only way to see is to 1) rely on asymptotics or 2) collect more than one sample.

- In general, more flexibility means more variance.

---
class: inverse

# Testing the Model

&lt;img src=&quot;data:image/png;base64,#Lecture1_files/figure-html/unnamed-chunk-17-1.png&quot; width=&quot;75%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---
class: inverse

# Testing the Model

`\(\sigma^2\)` - the idiosyncratic error that we cannot catch due to noise

- Maybe we've omitted terms from the model that are uncorrelated with the set of predictors?

- Maybe the processes out in the world are truly random and we see that in our data?

- This error is **irreducible**.  There's nothing we can do (short of adding more stuff to the model) that will get rid of this error.

---
class: inverse

# Testing the Model

Goal: Estimate `\(f()\)` in a way that allows us **to make predictions** for data we have not yet seen.

--

The optimal `\(f(X)\)`:

`$$\underset{f(X)}{\text{argmin}} \frac{1}{N} \sum \limits_{i = 1}^N \left(y_i - \hat{y}_i \right)^2$$`

--

So, our `\(f()\)` is the one that **minimizes the MSE of our training data**.

---
class: inverse

# Testing the Model

Goal: Estimate `\(f()\)` in a way that allows us **to make predictions** for data we have not yet seen.

--

Problem: With one sample, we cannot know what is bias, variance, or noise.

- In fact, the concept of variance doesn't even apply to a single sample!

- So, the optimal solution here is the one that minimizes **bias**.

-- 

If we're strictly minimizing the MSE for the data we see, then we are finding `\(f()\)` that ignores the between sample variance!

---
class: inverse

# Testing the Model

Goal: Estimate `\(f()\)` in a way that allows us **to make predictions** for data we have not yet seen.

--

A fundamental problem: if we optimize to the data we see then we're doing a pretty crappy job of meeting our goal!

- If we ignore variance, then we're doomed to **overfit** our models.

- The model will fit well to the data we see, but do a bad job of making out-of-sample predictions!

# Prediction

We have a fundamental problem!

- We want to know the true `\(f(X)\)` so we can predict outcomes we haven't seen.

- We only get one sample (usually) to train the model.

- We cannot really assess variance, so we minimize bias.

- We're left with a model that does not achieve our goal!

--

This is called the **bias/variance tradeoff** and will be the topic of our lectures over the next couple of weeks.

---
class: inverse

# Prediction

Needless to say, there are a lot of approaches and choices that must be made when building a predictive model.

- The first 2/3 of this class will be centered on these techniques.

--

In our next class, we're going to review **regression** and discuss how it can be used as a parametric method for building predictive models.

- Regression is a key component of this class.

- We'll review, but I'm assuming that everyone here has already had at least one class discussing the ins and outs of linear regression.

---
class: inverse

# Prediction

Use regression as the bridge to important concepts of model fitting and prediction:

- Loss functions

- In-sample vs. Out-of-Sample predictive ability

- Bias/variance trade-off

- Curse of Dimensionality

---
class: inverse

# Wrap-up

The statistical learning philosophy:

- Understand the various techniques in order to know how and when to use them.

- Understand the simpler methods as building blocks for more complicated ones

- Understand the trade-off between simple and complicated methods

- Understand how to assess performance of an approach.

- Understand that methods have many cross-disciplinary applications

--

These together are a fundamental ingredient in the training of a modern data scientist!
